package com.brazedblue.intervox.dicom;class DicomElementTag {  String fTag;  int fGroupNum = 1;  DicomElementTag(String group, String element) {    fGroupNum = Integer.parseInt(group, 16);    fTag = group + "," + element;  }  DicomElementTag(String tag) {    fTag = tag;    fGroupNum = Integer.parseInt(tag.substring(0, 4), 16);  }  public String GetString() {    return fTag;  }  public String toString() {    return super.toString() + ", fTag- " + fTag;  }  boolean IsEvenGroup() {    return (fGroupNum % 2) == 0;  }}